import { Button } from "../components/ui/button";
import EmojiRain from "../components/EmojiRain";


export default function Home() {
  return (
    <div className="relative min-h-screen flex items-center justify-center bg-gradient-to-br from-purple-900 via-indigo-900 to-gray-900 overflow-hidden">
      <div className="absolute w-[600px] h-[600px] bg-purple-700 rounded-full mix-blend-multiply filter blur-3xl opacity-30 animate-pulse -top-40 -left-40"></div>
      <div className="absolute w-[500px] h-[500px] bg-indigo-700 rounded-full mix-blend-multiply filter blur-2xl opacity-40 animate-pulse -bottom-20 -right-20"></div>

      <div className="z-10 bg-white/10 backdrop-blur-md shadow-2xl rounded-3xl p-10 max-w-2xl w-full text-center border border-white/20">
      <EmojiRain />
        <h1 className="text-5xl font-extrabold text-white drop-shadow mb-6">
          Welcome to <span className="text-purple-300">Food Finder üç±</span>
        </h1>
        <p className="text-lg text-white/80 font-medium mb-8">
          Discover personalized Japanese food recommendations based on your preferences, location, and style.
        </p>
        <Button className="text-lg px-8 py-3 bg-purple-600 hover:bg-purple-700 text-white border-2 border-white/20">
          Get Started ‚Üí
        </Button>
      </div>
    </div>
  );
}
